import React from 'react';
import {BrowserRouter, Route, Switch } from 'react-router-dom';
import App from './App';

const Router = () => (
    <BrowserRouter>
    <Switch>
        <Route component={App} />
    </Switch>
    </BrowserRouter>
);

export default Router;
